import axios from 'axios';

class Services extends Component {
  async componentDidMount() {
    const response = await axios.get(
      'https://jsonplaceholder.typicode.com/posts',
      {}
    );
    console.log(response.data);
  }

  render() {
    return (
      <div>
        <h2>Services</h2>
      </div>
    );
  }
}

export default Services;
